script: |
  super -f text -I q1865.spq | sort > q1865.out

inputs:
  - name: q1865.spq
    data: |
      SELECT MAX ( - ( 14 ) ) FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) cor1 WHERE + 65 + - 75 IS NOT NULL;
  - name: tab2

outputs:
  - name: q1865.out
    data: |
      -14
